import { backendAPI } from '@instinct-prj/frontend';
export class GangServiceImplementation {
  async getAll() {
    const gangs = await backendAPI.get('gangs');
    return gangs.data;
  }

  async getByID(gangID) {
    const gang = await backendAPI.get(`gangs/${gangID}`);
    return gang.data;
  }

}
